import { useState } from "react";
import { useEffect } from "react";
import CreateUsersItems from "./components/CreateUsersItems";
import { TEST_URL } from './MAIN.js';

function UsersList() {
    const [errors, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [GettedUsers, setGettedUsers] = useState([]);

    const [userItems, setUserItems] = useState(GettedUsers)

    function GetUsers() {

        useEffect(() => {
            fetch(TEST_URL)
                .then(response => response.json())
                .then(
                    (result) => {
                        setIsLoaded(true);
                        setUserItems(result);
                    },
                    (error) => {
                        setIsLoaded(true);
                        setError(error);
                        console.log(errors);
                        console.log(isLoaded);
                    }
                )
        }, [])
        return GettedUsers;
    };
    GetUsers();


userItems

const deleteUser = (item) => {
    setUserItems(userItems.filter(i => i.id !== item.id))
};

// function UsersList {
    
// }

    return (
        <div className="App">
            <header className="header flex">
                <div className="conteiner header_conteiner flex">
                    <div className="header_mem_text">
                        <h1>Logo</h1>
                    </div>
                    <div className="authentication flex">
                        <a href="login.html" className="home_page_link header_link flex">
                            <span>Вход</span>
                        </a>
                        <a href="registration.html" className="home_page_link header_link flex">
                            <span>Регистрация</span>
                        </a>
                    </div>
                </div>
            </header>
            <div class="back_btn">
                <a href="index.html" class="back_btn_link">Назад</a>
            </div>
            <main className="main">
                <div className="container home_page_container">
                    {userItems.map(item =>
                        <GetUsersItem item={item} key={item.id} />
                    )}
                </div>
            </main>
            <footer className="footer">

            </footer>
        </div>
    );
};

export default Users;
